import AmCharts from "@amcharts/amcharts3-react";
import React, { Component } from 'react';


class Maps extends Component {
  render(){
        const map = {
            "type": "map",
            "theme": "light",
            "colorSteps": 10,
            "dataProvider": {
                "map": "worldHigh",
                "areas": [],
                "getAreasFromMap" : true,
            "areasSettings": {
                "autoZoom": true,
                "rollOverColor" : "#9EC2F7",
            },
            // "valueLegend": {
            //     "right": 10,
            //     "minValue": "little",
            //     "maxValue": "a lot!"
            // },
            "listeners": [{
                "event": "descriptionClosed",
                "method": function(ev) {
                    ev.chart.selectObject();
                }
            }]
        }}
      return(
          <div>
            <AmCharts.React style={{width: "1000px", height: "450px"}} options= {map}/>
        </div>)
  }
}


  export default Maps;
